// mb define apikey

const Stock = {
    search(APIid){
        return( 
            [
                { y: (APIid * 10), label: "Jan34" },
                { y: 150, label: "Feb34" },
                { y: 152, label: "Mar34" },
                { y: 148, label: "Apr34" },
                { y: (APIid * 8), label: "Maydf" },
                { y: 150, label: "Judfn" },
                { y: 146, label: "Judfl" },
                { y: (APIid * 11), label: "Ausdfg" },
                { y: 153, label: "Sesdfpt" },
                { y: 158, label: "Ofdbct" },
                { y: (APIid * 12), label: "abfNov" },
                { y: 150, label: "Dsdfec" }
            ]
        )
    }
}

export default Stock
